import React from 'react'
import styled from 'styled-components';

const Check = styled.div`
  color: #676767;
  font-size: 12px;
  font-weight: 600;
`;

const Checkbox = props => {
         <Check><input type='checkbox' {...props}/></Check>
}

export default Checkbox;
